import React from "react";

import {Home, ListAlt, ExitToApp, HowToReg} from '@material-ui/icons/';

function Navbar(props){
    return (
        <header>
            <div class="topnav homepage">
                <a class={props.page=="homepage"? "active":""} href="#"><Home />Home</a>
                <a class={props.page=="menu"? "active":""} href="#"><ListAlt />Menu</a>
                <a class={props.page=="login"? "active":""} href="#"><ExitToApp />Log In</a>
                <a class={props.page=="signup"? "active":""} href="#"><HowToReg />Sign Up</a>
            </div>
        </header>
    );
}
export default Navbar;
